	(2, 40, 8, 'Provide all necessary skilled labor and materials to execute the modifications outlined in ASI #40. This includes extending Wall B10 on the electrical closet and adjusting the exterior perimeter wall to extend the DensGlass sheathing and rigid insulation down past the top of the concrete foundation, securing it to the 1" Z-furring attached to the concrete wall. All work must comply with the project specifications and standards. ', 'Amy Boehcke', 1, '2024-11-05 17:54:14', NULL, NULL),
	(3, 40, 8, 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s', 'Charm Ribs', 1, '2024-11-05 17:54:14', NULL, NULL),
	(4, 41, 5, 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old.', 'Eno Chelbly', 1, '2024-11-05 17:54:14', NULL, NULL),
	(5, 42, 4, 'At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident,', 'Calvin Puso', 1, '2024-11-05 17:54:14', NULL, NULL);
